sidebarCSS:
#root.root {--status-active: #47cfff;}
#root.root {--windows-popup-window-border: rgb(183, 189, 248);}
#root.root {--tabs-progress-bg: rgba(255,255,255,0.086);}
#root.root {--tabs-normal-fg: rgb(202, 211, 245);}
#root.root {--tabs-activated-fg: rgb(202, 211, 245);}
#root.root {--toolbar-el-overlay-clicked-bg: rgb(24, 25, 38);}


#root.root {--tabs-font: 1rem Monospace;}
#root.root {--ctx-menu-font: 1rem Monospace;}
#root.root {--ctx-menu-min-width: 134px;}
#root.root {--ctx-menu-max-width: 9999px;}

/* unloaded tab title style */
.Tab[data-discarded="true"] .title {
    opacity: 80%;
}

/* adjustments */
#root.root {--tabs-indent: 16px;}
#root.root {--tabs-audio-btn-width: 32px;}
#root.root {--tabs-inner-gap: 4px;}

/*** hover effects ***/
#root:not(:hover) {
    --tabs-indent: 0px;
}
/* ident indicator ********************************************/
/* Settings > Tabs > Show marks to indicate tabs sub-tree levels > on */
.Tab .title {
    transition: margin-left 300ms ease;
}
.Tab:hover {
    --tabs-inner-gap: 8px;
}
.Tab:hover .title {
    margin-left: 8px;
}
